function createMovieCopy(obj, data) {
  const copy1 = Object.assign({}, obj);
  const copyEnd = Object.assign(copy1, data);
  return copyEnd;
}

module.exports = {
  getAll: (section) => new Promise((resolve, reject) => {
    const selectedSearch = movies[section];
    if (!selectedSearch) {
      console.log('SELECTED SEARCH');
      return resolve(movies);
    }
    if (section) {
      return resolve(selectedSearch);
    }
  }),
  getOneObject: (section, name) => new Promise((resolve, reject) => {
    if (!section) return null;
    const selectedSearch = movies[section];

      if (!selectedSearch) {
        return reject('No hay una sección con ese nombre');
      }
    const search = selectedSearch.find((item) => item.name === name);
    return resolve(search);
  }),
  createOne: (section, { name, img }) => new Promise((resolve, reject) => {
    if (!section) return null;
    const selectedSearch = movies[section];

      if (!selectedSearch) {
        return reject('No hay una sección con ese nombre');
      }
    const data = {
      name,
      img
    }
    console.log(section, data);
    selectedSearch.push(createMovieCopy(movie, data));
    return resolve(movies);
  }),
  updateOne: (section, { id, name, img }) => new Promise((resolve, reject) => {
    if (!section) {
      console.log('SECTION');
      return reject(selectedSearch);
    }
    const search = movies[section].find((items) => items.id === id);
    search.name = name;
    if (img) {
      search.img = img;
    }
    return resolve(search);
  }),
  deleteOne: (section, id) => new Promise((resolve, reject) => {
    if (!section) return null;
    const selectedSearch = movies[section];

    if (!selectedSearch) {
      return reject('No hay una sección con ese nombre');
    }
    console.log(selectedSearch);
    const search = selectedSearch.find((items) => items.id === id);
    const index = selectedSearch.indexOf(search);
    selectedSearch.splice(index, 1);
    return resolve(search);
  })
}
